import React from "react";
import ReactCarousel from 'react-elastic-carousel';

const HomePage = () =>{
    return (

        <div> 
            Home Page
            <div>
            <ReactCarousel itemsToShow={5}>
                <div>1</div>
                <div>2</div>
                <div>3</div>
                <div>4</div>
                <div>5</div>
            </ReactCarousel>
            </div>
        </div>

    )
}

export default HomePage;
